
#include <string>
#include <iostream>
#include <unordered_set>
#include <map>

class Solution {
public:
    int lengthOfLongestSubstring(std::string s) {
        int n = s.length();
        int ans = 0, i = 0, j = 0;
        std::unordered_set<char> charSet;

        while(i < n && j < n){
            char ch = s[j];
            if(charSet.find(ch) == charSet.end()){
                charSet.insert(s[j++]);
                ans = std::max(ans, j-i);
            }
            else{
                charSet.erase(s[i++]);
            }
        }
        return  ans;

    }

    int lengthOfLongestSubstring2(std::string s)
    {
        int n = s.length();
        int ans = 0;

        std::map<char, int> charMap;

        for (int j=0, i=0; j<n; j++){

            if(charMap.find(s[j]) != charMap.end()){
                i = std::max(charMap[s[j]], i);
            }
            ans = std::max(ans, j-i+1);
            charMap[s[j]] = j+1;
        }
        return ans;
    }
};




